function parseWords(locations) {
    var coords = [];
    for (var i = 0; i < locations.length; i += 2) {
        var tmp = [];
        var iter = i / 2;
        tmp[0] = parseFloat(locations[i]);
        tmp[1] = parseFloat(locations[i+1]);
        coords[iter] = tmp;
    }
    return coords;
}
